import { Link } from "react-router-dom";

export default function Header(){
    return(
        <header>
        <Link href="/" className="logo"> My App</Link>
        <nav>
          <Link to="/login" className="login">Login</Link>
          <Link to="/register" className="register">Register</Link>
        </nav>
        </header>
    )
}
